import { React, useState } from "react";
import { Col, Form, Row } from "react-bootstrap";
import { NavLink } from "react-router-dom";
import DoctorMenu from "../../../components/layout/DoctorMenu";

const Step1 = () => {
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    suffix: "",
    customerDate: "",
    age: "",
    gender: "Male",
    feet: "",
    inch: "",
    dominantHand: "Right",
    guardianFirstName: "",
    guardianLastName: "",
    guardianSuffix: "",
    organization: "Org 1",
    email: "",
    phone: "",
    address: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    console.log("Submitting Form:", formData);
  };

  return (
    <DoctorMenu>
      <h3> Client Information</h3>
      <Form onSubmit={handleSubmit}>
        <Row>
          <Col md={6}>
            <Form.Group controlId="firstName">
              <Form.Label className="text-black">First Name</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter first name"
                name="firstName"
                value={formData.firstName}
                onChange={handleChange}
              />
            </Form.Group>
          </Col>
          <Col md={6}>
            <Form.Group controlId="lastName">
              <Form.Label className="text-black">Last Name</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter last name"
                name="lastName"
                value={formData.lastName}
                onChange={handleChange}
              />
            </Form.Group>
          </Col>
        </Row>
        <Row>
          <Col md={6}>
            <Form.Group controlId="suffix">
              <Form.Label className="text-black">Suffix</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter suffix"
                name="suffix"
                value={formData.suffix}
                onChange={handleChange}
              />
            </Form.Group>
          </Col>
          <Col md={6}>
            <Form.Group controlId="customerDate">
              <Form.Label className="text-black"> Date Of Birth</Form.Label>
              <Form.Control
                type="date"
                name="dob"
                value={formData.dob}
                onChange={handleChange}
              />
            </Form.Group>
          </Col>
        </Row>

        <Row>
          <Col md={6}>
            <Form.Group controlId="age">
              <Form.Label className="text-black">Age</Form.Label>
              <Form.Control
                type="number"
                placeholder="Enter age"
                name="age"
                value={formData.age}
                onChange={handleChange}
              />
            </Form.Group>
          </Col>
          <Col md={6}>
            <Form.Group controlId="gender">
              <Form.Label className="text-black">Gender</Form.Label>
              <Form.Control
                as="select"
                name="gender"
                value={formData.gender}
                onChange={handleChange}
              >
                <option>Male</option>
                <option>Female</option>
                <option>Other</option>
              </Form.Control>
            </Form.Group>
          </Col>
        </Row>
        <Row>
          <Col md={3}>
            <Form.Group controlId="height">
              <Form.Label className="text-black ">Height</Form.Label>
              <Form.Control
                as="select"
                name="feet"
                value={formData.feet}
                onChange={handleChange}
                className="w-100"
              >
                <option>Feet</option>
                {/* Add possible numbers for feet */}
              </Form.Control>
            </Form.Group>
          </Col>
